☑️с опытом работы от 2 лет;
☑️уверенное знание Swift;
☑️с опытом использования CoreData и знанием принципов работы баз данных;
☑️с пониманием жизненного цикла приложения;
☑️с опытом использования REST, WebSocket;
☑️с умением работать с потоками;


Будет отлично, если:

☑️у вас опыт больше 2х лет.
☑️отлично понимаете и можете обосновать применение различных паттернов проектирования;
☑️есть успешные п1риложения в App Store;
☑️есть open source проекты на github;


Пишите и присылайте свои резюме:  vyangurskaya@4xxi.com, @vyangurskaya

